import React from "react";

function Deals() {
    return (
        <div class = "grid-container">
            <div class = "wheelitem">

            </div>
            <div class = "dailydeals">
                <div class = "dealcard rounded">
                
                </div>

            </div>
            <div class = "weeklydeals">
            <div class = "dealcard rounded">
                    <img src="" class="img-fluid" alt="food-deal"/>
                </div>
            </div>
        </div>
    );
}

export default Deals;
